jmespath = ">=0.7.1,<2.0.0"
python-dateutil = ">=2.1,<3.0.0"
urllib3 = ">=1.25.4,<1.27"

[package.extras]
crt = ["awscrt (0.16.9)"]

[[package]]
category = "main"
description = "Type annotations and code completion for botocore"
name = "botocore-stubs"
optional = false
python-versions = ">=3.7,<4.0"
version = "1.29.88"

[package.dependencies]
types-awscrt = "*"

[[package]]
category = "dev"
description = "Composable command line interface toolkit"
name = "click"
optional = false
python-versions = ">=3.7"
version = "8.1.3"

[package.dependencies]
colorama = "*"

[[package]]
